  [],\n\t\"title\": \"Geodatabase of the datasets used to represent the four aquifer
  subunits of the Cambrian-Ordovician aquifer system, Illinois, Iowa, Michigan, Minnesota,
  and Wisconsin\",\n\t\"tracking_summary\": {\n\t\t\"total\": 32,\n\t\t\"recent\":
